import React from "react";
import styled from "styled-components";

const MemberTemplate_block = styled.div`
  width: 60vw;
  height: 100vh;
  background: white;
  margin-left: 20vw;
  position: relative;
`;
const MemberHead = styled.div`
  width: auto;
  height: 15vh;
`;

function MemberTemplate({ children }) {
  return <MemberTemplate_block>{children}</MemberTemplate_block>;
}

export default MemberTemplate;
